import { Link } from 'react-router-dom';

import * as Yup from 'yup';
import { useDispatch, useSelector } from 'react-redux';
import InputMask from 'react-input-mask';

const schema = Yup.object().shape({
  cell_phone: Yup.string().required('O celular é obrigatório'),
  password: Yup.string().required('A senha é obrigatória'),
});

export default function SignIn() {


  return (
    <>
      <nav
        style={{
          display: 'flex',
          flexDirection: 'row',
          justifyContent: 'space-around',
          alignItems: 'baseline',
        }}
      >
        <img alt="Xeique" />
        <Link to="/ob-be-partner-sign-in">
          <h1 style={{ color: '#FF65A5' }}>
            Seja um parceiro
          </h1>
        </Link>
      </nav>
      <img  alt="Xeique" />
      <p>Faça seu login e comece a aculumar pontos a cada compra!</p>
      <Form schema={schema} >
        <InputMask mask="(99) 9 9999-9999">
          {inputProps => (
            <Input
              {...inputProps}
              type="tel"
              name="cell_phone"
              placeholder="Seu número de celular"
            />
          )}
        </InputMask>
        <Input
          name="password"
          type="password"
          placeholder="Sua senha secreta"
        />
        <button variant="contained" color="primary" type="submit">
          Carregando
        </button>
        <button />
        <h1 >Criar conta gratuíta</h1>
        <h1 >Recuperar a minha senha</h1>
      </Form>
    </>
  );
}
